import React from "react";
import { useState, useEffect } from "react";
import Home from  './pages/home';
import { ChakraProvider } from "@chakra-ui/react";

function App() {
  return (
    <div>
      <ChakraProvider
      >
          <Home/>
      </ChakraProvider>
    </div>
  );
}

export default App;
